import { Link } from "react-router-dom"
import "./signin.css"

export default function SignIn() {
  const userRef = useRef()
  const passwordRef = useRef()

  const handleSubmit = (e) => {
    e.preventDefault()
  }
  return (
    <div className="signin">
      <span className="signinTitle">SignIn</span>
      <form className="signinForm" onSubmit={ handleSubmit }>
        <label>Username</label>
        <input type="text " className="signinInput" placeholder="Enter your username..." />
        <label>Password</label>
        <input type="password" className="signinInput" placeholder="Enter your password..." />
        <button className="signinBtn" type="submit">SignIn</button>
      </form>
      <button className="signupRegisterBtn">
        <Link className="link" to="/signup">SignUp</Link>
      </button>
    </div>
  )
}
